using Refit;
using SendMailFunction.Adaptees;
using SendMailFunction.Dtos;
using SendMailFunction.Services.Interfaces;
using System;
using System.Collections.Generic;
using System.Threading.Tasks;

namespace SendMailFunction.Adapters
{
    public class EmailServiceAdapter : IEmailServiceTarget
    {
        private readonly ILogicAppEmailAdaptee _adaptee;
        private readonly string _baseUrl;

        public EmailServiceAdapter()
        {
            _baseUrl = Environment.GetEnvironmentVariable("Logic-App-Email");
            _adaptee = RestService.For<ILogicAppEmailAdaptee>(_baseUrl);
        }
        public async Task SendMailAsync()
        {
            await _adaptee.SendEmailAsync(BuildTestEmail());
        }

        private Email BuildTestEmail()
        {
            var attachments = new List<Attachments>();
            var attachment = new Attachments
            {
                ContentBytes = "",
                Name = "image.jpeg"
            };

            attachments.Add(attachment);

            return new Email
            {
                To = new List<string> { "gabriel_3404@hotmail.com" },
                Subject = "Subject teste function",
                Body = "Body teste function,",
                Attachments = attachments
            };
        }
    }
}